Movie Info: Kadal Kadannu Oru Maathukutty is a 2013 Malayalam comedy film written and directed by Ranjith and starring Mammootty in the lead role of an Achayan from Travancore. The cast includes Nedumudi Venu and Balachandra Menon, Siddique, Harisree Asokan, Suresh Krishna, P. Balachandran, Balachandran Chullikad, Prem Prakash, Meera Nandan, Muthumani, Krishna Prabha and Kaviyoor Ponnamma. Madhu Neelakandan is the cinematographer and Shahabas Aman is the music director.

The Film is produced by Prithviraj, Santhosh Sivan, and Shaji Natesan under the banner of August Cinema, and released on August 8, 2013.

